import React, {useState} from 'react'

import {Wrapper} from '../components/Styled';

import styled from "styled-components";

const Container = styled(Wrapper)`
    justify-content:center;
    align-items:center;
`

const Item = styled.div`
    width:100%;
    max-width:20em;
`

const TopBar = styled.div`
    background-color:var(--p-3);
    padding:.2em;
    border:1px solid var(--p-0);

`

const Title = styled.h3`
    width:100%;
    max-width:20em;
`

const Circle = styled.div`
    height:100%;
    height:3em;

    width:3em;
    background-color:var(--s-3);
    border-radius:50%;

`

export default function Lebenslauf() {
    const [active, setActive] = useState(2);

    return (
        <Container>
            <Item>
                <TopBar onClick={()=>setActive(1)}>
                    <Circle>

                    </Circle>
                    <Title>hello</Title>
                </TopBar>
                {active===1 &&
                    <p>expand</p>
                }
            </Item>
            <Item onClick={()=>setActive(2)}>
                <Title onClick={()=>setActive(2)}>hello</Title>
                {active===2 &&
                    <p>expand</p>
                }
            </Item>
            <Item onClick={()=>setActive(3)}>
                <Title onClick={()=>setActive(3)}>hello</Title>
                {active===3 &&
                    <p>expand</p>
                }
            </Item>
        </Container>
    )
}
